import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class AuthService {

  constructor() { }

  currentUser?: User;


  loginUser(user: User) {
    if (user.email) {
      console.log("Log in with email : " + user.email);
      this.currentUser = user;
    }
  }
}


interface User {
  email: string;
}
